import React from 'react'

const StoryItems = (props) => {
    return (
        <section className={props.classes}>

            <h3>{props.title}</h3>
            <h3>{props.topic}</h3>
            <p>{props.entry}</p>
        </section>
    )
}

export default StoryItems
